function getPms(k){
	
	let pointRun = [],
		lineRun = []
	
	for (let tar of dict[k]) {
		let coords = tar.kml.split(' ')
		let coord = []
			
		for (let s of coords) {
			let c = s.split(',')
			coord.push([Number(c[0]),Number(c[1]),Number(c[2])])
		}
		
		const getLine = (name,coord)=>{
			return {
				_id: geotools.uniqId(),
				name,
				t2: 10,
				t1: 1,
				speed: tar.speed,
				coord
			}
		}
		
		let arr = []
		for (var i = 0; i < coord.length; i++) {
			arr.push(coord[i])
			if(i>10) {
				let {len} = geotools.calData(arr)
				if(len>=tar.len) {
					pointRun.push(getLine(tar.name+(pointRun.length+1)+'队',arr))
					arr = []
				}
			}
		}
		pointRun.push(getLine(tar.name+(pointRun.length+1)+'队',arr))
		lineRun.push(getLine(tar.name,coord))
	}
	return { pointRun, lineRun }
}
function getKml(keys) {
	
	let pms = [...place]
	for (let k of keys) {
		for (let tar of dict[k]) {
			let coords = tar.kml.split(' ')
			let coord = []
				
			for (let s of coords) {
				let c = s.split(',')
				coord.push([Number(c[0]),Number(c[1]),Number(c[2])])
			}
			
			const getLine = (name,coord)=>{
				return {
					_id: geotools.uniqId(),
					name,
					t2: 10,
					t1: 1,
					coord
				}
			}
			pms.push(getLine(tar.name,coord))
		}
	}
	
	return pms 
}

